import React from 'react';

import { NavToProdBtn } from '../components';

import napkinsImg from '../assets/napkins.webp';
import toiletsImg from '../assets/toilets.webp';

import './HomePage.css';

export const HomePage = () => {
	return (
		<section className="home-page__container" data-theme="light">
      <nav className="home-page__navigation">
        <NavToProdBtn link='/production' imgSrc={napkinsImg} alt='Салфетки' />
        <NavToProdBtn link='/production' imgSrc={toiletsImg} alt='Туалетная бумага' />
      </nav>
		</section>
	);
}
